bool IsPaletteOutOfSync(UINT16 char_id, UINT16 source_palette, UINT16 compare_char, UINT16 destination_palette)
{
    bool paletteChangesAreOutOfSync = false;

    for (int nValIndex = 0; nValIndex < ARRAYSIZE(char_val_array); nValIndex++)
    {
        if ((char_id == char_val_array[nValIndex].character_number) &&
            (source_palette == char_val_array[nValIndex].source_palette) &&
            (compare_char == char_val_array[nValIndex].compare_character) &&
            (destination_palette == char_val_array[nValIndex].destination_palette))
        {

#ifdef DEBUG
            // Our table is giant: quick check to validate that we don't have no-op checks.

            if ((char_val_array[nValIndex].character_number == char_val_array[nValIndex].compare_character) &&
                (char_val_array[nValIndex].source_palette == char_val_array[nValIndex].destination_palette))
            {
                CString strMsg;
                strMsg.Format(_T("\nPlease remove no-op check for        0x%x /* %s */, 0x%x, { "), char_id, MVC2_D_UNITDESC[char_id], char_val_array[nValIndex].destination_palette);
                OutputDebugString(strMsg);
            }
#endif

            bool sourceIsChanged = false, destinationIsChanged = false;

            // both should match stock values. if EITHER both are matching OR neither matches then we are happy.
            UINT16* source_colors = get_pal_16(char_id, source_palette);

            for (UINT16 nIndex = 0; nIndex < 16; nIndex++)
            {
                if (source_colors[nIndex] != char_val_array[nValIndex].sourceColors[nIndex])
                {
                    sourceIsChanged = true;
                    break;
                }
            }

            UINT16* destination_colors = get_pal_16(compare_char, destination_palette);
            for (UINT16 nIndex = 0; nIndex < 16; nIndex++)
            {
                if ((nIndex == 0) && (char_val_array[nValIndex].destColors[nIndex] != 0x0))
                {
                    OutputDebugString(_T("Bogus step detected: please fix.\n"));
                }

                if (destination_colors[nIndex] != char_val_array[nValIndex].destColors[nIndex])
                {
                    destinationIsChanged = true;
                    break;
                }
            }

#ifdef USE_THIS_TO_DUMP_COLOR_TABLES

            if (char_id == 0x14) // sonson <- insert your current character of interest here.
            {
                static UINT16 lastSourcePal = 0xFFFF;
                static UINT16 lastDestPal = 0xFFFF;

                if ((lastSourcePal == char_val_array[nValIndex].source_palette) &&
                    (lastDestPal == char_val_array[nValIndex].destination_palette))
                {
                    CString strMsg;
                    strMsg.Format(_T("Error: duplicate check found in validation table for character %s (0x%x) at 0x%x to 0x%x :\n"), MVC2_D_UNITDESC[char_id], char_id, char_val_array[nValIndex].source_palette, char_val_array[nValIndex].destination_palette);
                    OutputDebugString(strMsg);
                }

                lastSourcePal = char_val_array[nValIndex].source_palette;
                lastDestPal = char_val_array[nValIndex].destination_palette;

                // Use this to dump out the vanilla colors.
                CString strMsg;
                strMsg.Format(_T("    {   0x%x /* %s */, 0x%02x, { "), char_id, MVC2_D_UNITDESC[char_id], char_val_array[nValIndex].source_palette);
                OutputDebugString(strMsg);
                for (UINT16 nIndex = 0; nIndex < 16; nIndex++)
                {
                    strMsg.Format(_T(" 0x%x,"), source_colors[nIndex]);
                    OutputDebugString(strMsg);
                }

                OutputDebugString(_T(") },\n"));

                strMsg.Format(_T("        0x%x /* %s */, 0x%02x, { "), char_id, MVC2_D_UNITDESC[char_id], char_val_array[nValIndex].destination_palette);
                OutputDebugString(strMsg);
                for (UINT16 nIndex = 0; nIndex < 16; nIndex++)
                {
                    strMsg.Format(_T(" 0x%x,"), destination_colors[nIndex]);
                    OutputDebugString(strMsg);
                }

                OutputDebugString(_T(" } },\n"));
            }
#endif

            if (sourceIsChanged && !destinationIsChanged)
            {
                // We really only care if they modified the source palette AND it wasn't reflected in the Extras.
                // Our supp logic is not equivalent to the stock logic, so an unmodified source will reflect incorrectly in Extras.
                paletteChangesAreOutOfSync = true;
            }
        }
    }

    return paletteChangesAreOutOfSync;
}

bool IsSpiralPaletteOutOfSync(UINT16 char_id, UINT16 source_palette, UINT16 compare_char, UINT16 destination_palette)
{
    bool paletteChangesAreOutOfSync = false;
    bool colorsDoNotMatch = false;

    // These sprites should match.
    UINT16* source_colors = get_pal_16(char_id, source_palette);
    UINT16* destination_colors = get_pal_16(compare_char, destination_palette);
    for (UINT16 nIndex = 0; nIndex < 16; nIndex++)
    {
        if (source_colors[nIndex] != destination_colors[nIndex])
        {
            // This can be true for the stock colors as well, so we double-check below.
            colorsDoNotMatch = true;
            break;
        }
    }

    if (colorsDoNotMatch)
    {
        for (int nValidationIndex = 0; nValidationIndex < ARRAYSIZE(char_val_array_spiral); nValidationIndex++)
        {
            if ((char_val_array_spiral[nValidationIndex].character_number == char_id) &&
                (char_val_array_spiral[nValidationIndex].source_palette == source_palette))
            {
                // Double-check that these aren't just unmodified.
                for (UINT16 nPalIndex = 0; nPalIndex < 16; nPalIndex++)
                {
                    if (source_colors[nPalIndex] != char_val_array_spiral[nValidationIndex].sourceColors[nPalIndex])
                    {
                        paletteChangesAreOutOfSync = true;
                        break;
                    }
                }

                break;
            }
        }
    }

    return paletteChangesAreOutOfSync;
}

bool AreEditsOutOfSync()
{
    bool editsAreOutofSync = false;

    for (palette_validation paletteToCheck : char_val_array)
    {
        if (IsPaletteOutOfSync(paletteToCheck.character_number, paletteToCheck.source_palette, paletteToCheck.compare_character, paletteToCheck.destination_palette))
        {
            bool fHaveMessage = false;
            if (!g_rgfCharacterHasIssues[paletteToCheck.character_number] &&
                ((paletteToCheck.compare_character != 0x31 /* Spiral */) || (paletteToCheck.character_number == 0x31))) // Ignore the source for Spiral palettes unless it's internal to Spiral
            {
                fHaveMessage = true;
                g_rgfCharacterHasIssues[paletteToCheck.character_number] = true;
            }

            if (!g_rgfCharacterHasIssues[paletteToCheck.compare_character])
            {
                fHaveMessage = true;
                g_rgfCharacterHasIssues[paletteToCheck.compare_character] = true;
            }

            if (fHaveMessage)
            {
                editsAreOutofSync = true;
                CString strMessage;
                strMessage.Format(_T("Issues found: %s at 0x%x is not in sync with %s at 0x%x\n"), MVC2_D_UNITDESC[paletteToCheck.character_number], paletteToCheck.source_palette,
                    MVC2_D_UNITDESC[paletteToCheck.compare_character], paletteToCheck.destination_palette);
                OutputDebugString(strMessage);
            }

            //dump_palettes(char_id, source_palette, compare_char, destination_palette);
        }
    }

    for (palette_validation paletteToCheck : char_val_array_spiral)
    {
        if (IsSpiralPaletteOutOfSync(paletteToCheck.character_number, paletteToCheck.source_palette, paletteToCheck.compare_character, paletteToCheck.destination_palette))
        {
            // Spiral is out of sync: we can stop there.
            g_rgfCharacterHasIssues[0x31] = true;
            editsAreOutofSync = true;

            CString strMessage;
            strMessage.Format(_T("Issues found: %s at 0x%x is not in sync with %s at 0x%x\n"), MVC2_D_UNITDESC[paletteToCheck.character_number], paletteToCheck.source_palette,
                MVC2_D_UNITDESC[paletteToCheck.compare_character], paletteToCheck.destination_palette);
            OutputDebugString(strMessage);

            //dump_palettes(char_id, source_palette, compare_char, destination_palette);
            break;
        }
    }

    return editsAreOutofSync;
}

void ValidateAllPalettes(BOOL *pfChangesWereMade, BOOL* rgPaletteChangeArray)
{
    // Reset the validation...
    for (palette_validation paletteToCheck : char_val_array)
    {
        g_rgfCharacterHasIssues[paletteToCheck.character_number] = false;
    }

    g_haveValidationData = true;
    *pfChangesWereMade = false;

    CString strUserMessage;

    if (AreEditsOutOfSync())
    {
        int issueCount = 0;

        // Simple list of the characters with issues.  Doesn't account Spiral copying paletes, though: it will show the *source* as well as Spiral.
        for (int nIndex = 0; nIndex < ARRAYSIZE(g_rgfCharacterHasIssues); nIndex++)
        {
            if (g_rgfCharacterHasIssues[nIndex])
            {
                if (issueCount == 0)
                {
                    strUserMessage = _T("Issues were found with the colors for: ");
                }
                else
                {
                    strUserMessage.Append(_T(", "));
                }
                strUserMessage.Append(MVC2_D_UNITDESC[nIndex]);
                issueCount++;

                CString strMessage;
                strMessage.Format(_T("Please fix %s (0x%x)\n"), MVC2_D_UNITDESC[nIndex], nIndex);
                OutputDebugString(strMessage);
            }
        }

        strUserMessage.Append(_T(".\n\nDo you want PalMod to try to fix that for you?"));
        switch (MessageBox(g_appHWnd, strUserMessage, GetHost()->GetAppName(),  MB_YESNO | MB_ICONERROR))
        {
            case IDYES:
            {
                FixAllProblemPalettes(rgPaletteChangeArray);
                *pfChangesWereMade = true;
                
                if (AreEditsOutOfSync())
                {
                    strUserMessage = _T("Unable to fix the edits, sorry.");
                }
                else
                {
                    strUserMessage = _T("Auto-modifications complete.\n\nIf you like the changes, make sure to Save/Patch them.");
                }
                MessageBox(g_appHWnd, strUserMessage, GetHost()->GetAppName(), MB_ICONINFORMATION);
                break;
            }
            default:
                break;
        }
    }
    else
    {
        strUserMessage = _T("The color edits seem to match correctly: nice work.");
        MessageBox(g_appHWnd, strUserMessage, GetHost()->GetAppName(), MB_ICONINFORMATION);
    }
}

void FixAllProblemPalettes(BOOL* rgPaletteChangeArray)
{
    UINT16 lastFixedCharacter = 0xFFFF;
    UINT16 lastFixedPalette = 0xFFFF;

    if (!g_haveValidationData)
    {
        BOOL fChangesWereMade = FALSE;
        ValidateAllPalettes(&fChangesWereMade, rgPaletteChangeArray);
    }

    for (palette_validation paletteToCheck : char_val_array)
    {
        if (g_rgfCharacterHasIssues[paletteToCheck.character_number] && 
            ((lastFixedCharacter != paletteToCheck.character_number)  || (lastFixedPalette != paletteToCheck.source_palette)))
        {
            CString strMessage;
            strMessage.Format(_T("Fixing %s palette 0x%x \n"), MVC2_D_UNITDESC[paletteToCheck.character_number], paletteToCheck.source_palette);
            OutputDebugString(strMessage);

            lastFixedCharacter = paletteToCheck.character_number;
            lastFixedPalette = paletteToCheck.source_palette;

            bool isModified = false;

            UINT16* source_colors = get_pal_16(paletteToCheck.character_number, paletteToCheck.source_palette);

            for (UINT16 nIndex = 0; nIndex < 16; nIndex++)
            {
                if (source_colors[nIndex] != paletteToCheck.sourceColors[nIndex])
                {
                    isModified = true;
                    break;
                }
            }

            if (isModified)
            {
                proc_supp(paletteToCheck.character_number, paletteToCheck.source_palette);
                OutputDebugString(_T("This was modified: FIXED.\n"));
            }
            else
            {
                OutputDebugString(_T("This is unmodified.\n"));
            }

            rgPaletteChangeArray[paletteToCheck.character_number] = TRUE;
        }
    }

    // Spiral logic... just bulk copy if we have a problem, since it's a flat copy instead of tinting or anything special.
    if (g_rgfCharacterHasIssues[indexCPS2_Spiral])
    {
        for (palette_validation paletteToCheck : char_val_array_spiral)
        {
            supp_copy_spiral(paletteToCheck.character_number, paletteToCheck.source_palette, paletteToCheck.destination_palette);
        }

        rgPaletteChangeArray[indexCPS2_Spiral] = TRUE;
    }

    for (palette_validation paletteToCheck : char_val_array)
    {
        g_rgfCharacterHasIssues[paletteToCheck.character_number] = false;
    }

    g_haveValidationData = false;

    OutputDebugString(_T("Complete!\n"));
}

